import { Document, Page } from "react-pdf";
import "./content.scss";

function Curriculum() {
  return (
    <div>
      <h1>CV</h1>
      <ul>
        <li key="cv-english" className="cv">
          <Document file="../Data/DanielaMLinsDeAraujoResume.pdf">
            <Page pageNUmber="1" />
          </Document>
        </li>
      </ul>
    </div>
  );
}

export default Curriculum;
